const myImg = new Image();
myImg.src = 'data:image/jpeg;base64,';

myImg.addEventListener('load', function() {
    const canvas = document.querySelector('canvas');
    const c = canvas.getContext('2d');
    canvas.width = 400;
    canvas.height = 550;

    c.drawImage(myImg, 0, 0, canvas.width, canvas.height);
    const pixels = c.getImageData(0, 0, canvas.width, canvas.height);
    c.clearRect(0, 0, canvas.width, canvas.height);

    let particlesArray = [];
    const numOfParticles = 4000;

    let mappedImg = [];
    for (let y = 0; y < canvas.height; y++) {
        let row = [];
        for (let x = 0; x < canvas.width; x++) {
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
            const brightness = calcRelativeBrigthness(red, green, blue);
            const cell = [
                cellBrightness = brightness,
            ]
            row.push(cell);
        }
        mappedImg.push(row);
    }

    function calcRelativeBrigthness(red, green, blue) {
        return Math.sqrt(
            (red * red) * 0.299 + 
            (green * green) * 0.587 + 
            (blue * blue) * 0.114
        )/100;
    }

    class Particle {
        constructor(){
            this.x = Math.random() * canvas.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 0.5;
            this.size = Math.random() * 1.5 + 1;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
        }
        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = mappedImg[this.position1][this.position2][0];
            let movement = (2.5 - this.speed) + this.velocity;

            this.y += movement;
            if(this.y >= canvas.height) {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
        }
        draw() {
            c.beginPath();
            c.fillStyle = 'white';
            c.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            c.fill();
        }
    }
    function init() {
        for (let i = 0; i < numOfParticles; i++) {
            particlesArray.push(new Particle);
        }
    }
    init();
    function animate() {
        c.globalAlpha = 0.05;
        c.fillStyle = 'rgb(0, 0, 0)';
        c.fillRect(0, 0, canvas.width, canvas.height);
        c.globalAlpha = 0.2;
        for (let i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update();
            c.globalAlpha = particlesArray[i].speed * 0.1;
            particlesArray[i].draw();
        }
        requestAnimationFrame(animate);
    }
    animate();
});
